import logo from './logo.svg';
import './App.css';
import Forum from './pages/forum'
import Counter from './pages/Counter';
import FunctionClick from './pages/FunctionClick.';
import ClassClick from './pages/ClassClick';

function App() {
    return (
        <>
            <FunctionClick />
            <ClassClick />
            <Counter />
            <Forum />
        </>
    )
}

export default App;
